// src/pages/Home.jsx
import React from "react";
import Header from "../components/Header";
import FilterBox from "../components/FilterBox";
import MatchList from "../components/MatchList";

const Home = () => {
  return (
    <>
      <Header />
      {<FilterBox />}
      {<MatchList />}
    </>
  );
};

export default Home;
